import './Cube.scss';

const Cube = () => (
  <section className="Cube">
    <div className="Buttons">

      <button className="CubeButtons__Button">Mainit kuba krasu</button>
      <button className="CubeButtons__Button">Mainit tekstu uz nospiests</button>
    </div>
    <div className="CubeAndSpan">
      <div className="ColoredCube" />
      <span className="CubeSpan"> Nav Nospiests</span>
    </div>
  </section>
);

export default Cube;
